import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import Card from './Card';
import Sdata from './Sdata';
console.log(Sdata[0]);
// import Project1 from './Project1'
// import Project2 from './Project2'
// root

ReactDOM.render(<>
<h1>List Off 5 Netflix Series</h1>

<Card imgsrc={Sdata[0].imgsrc} text={Sdata[0].text} title="Dark 1" link="https://www.netflix.com/pk/"/>

<Card imgsrc="https://wallpapercave.com/wp/wp4056410.jpg" text="A Netflix Orignal Series 2" title="Dark 2" link="https://www.netflix.com/pk/"/>

<Card imgsrc="https://wallpapercave.com/wp/wp4056410.jpg" text="A Netflix Orignal Series 3" title="Dark 3" link="https://www.netflix.com/pk/"/>


</>
,document.getElementById('root'));

